<script>
    $(document).ready(function(){
        $("#RT").hide("#RT");
        $("#LF").hide("#LF");
        $("#UP").hide("#UP");
        $("#DW").hide("#DW");

        $("#particles-js").hide("#particles-js");
        $("#particles-js2").hide("#particles-js2");


    });


    $(document).keydown(function(keyEvent) {
        if(keyEvent.keyCode == 66){
            $('#BB').toggle("#BB");
            $('#BB').show("#BB");

        }
        if(keyEvent.keyCode == 65){
            $('#AB').toggle("#AB");
            $('#AB').show("#AB");

        }
        if(keyEvent.keyCode == 40){

            $('#DW').show("#DW");
            $('#DW').toggle("#DW");


        }
        if(keyEvent.keyCode == 39){

            $('#RT').show("#RT");
            $('#RT').toggle("#RT");


        }
        if(keyEvent.keyCode == 37){

            $('#LF').show("#LF");
            $('#LF').toggle("#LF");


        }

        if(keyEvent.keyCode == 38){

            $('#UP').show("#UP");
            $('#UP').toggle("#UP");


        }
    });
    var konamiCodeKeys = ["ArrowUp", "ArrowUp", "ArrowDown", "ArrowDown", "ArrowLeft", "ArrowRight", "ArrowLeft", "ArrowRight", "b", "a", "Enter"]
    var keysPressed = [];

    $(document).keyup(function(event){
        //console.log(event.key);
        keysPressed.push(event.key);
        if(keysPressed.length > 11) {
            keysPressed.shift();
        }
        if(konamiCodeKeys.toString().toLowerCase() === keysPressed.toString().toLowerCase()) {
            $("#particles-js").show("#particles-js");
            $("#particles-js2").show("#particles-js2");
            $(".faws").hide(".faws");
        }
        console.log(keysPressed);
    });

</script>
